import React from 'react'
import { NavLink } from 'react-router-dom'


export default function SignedIn() {
    return (
        <ul className="right">

            <li><NavLink to="/"><i class="material-icons">collections</i></NavLink></li>
            <li><NavLink to="/"><i class="material-icons">add_a_photo</i></NavLink></li>
            <li><NavLink to="/"><img style={{width:"35px",height:"35px",borderRadius:"40px",margin:"auto"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/></NavLink></li>

        </ul>

    )
}
